import React from 'react'
import styled from 'styled-components'
import { Spin } from 'antd'

const StyledCardLoader = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  position: absolute;
  background-color: white;
  border-radius: 10px;
  align-items: center;
  justify-content: center;
  border: 1px solid #e3e3e3;
`

export default () => {
  return (
    <StyledCardLoader>
      <Spin />
    </StyledCardLoader>
  )
}
